import React from 'react'; 
import './Moves.css';

const Moves = () => {
	return (
		<div id="moves"> 
			<div id="top_row"> Moves </div>
			<div id="moves_table">
				<div class="moves_row"> <span class="move_number">1</span> <span class="move_white"> e4 </span> <span class="move_black"> e5 </span> </div>
				<div class="moves_row"> <span class="move_number">2</span> <span class="move_white"> e4 </span> <span class="move_black"> e5 </span> </div>
				<div class="moves_row"> <span class="move_number">3</span> <span class="move_white"> e4 </span> <span class="move_black"> e5 </span> </div>
			</div>
		</div>
	);
}

export default Moves;
